=head1 DESCRIPTION

The name of a prepared statement that could not be returned.

=head1 ATTRIBUTES


=head2 ErrorCode => Str

The error code returned when the request for the prepared statement
failed.


=head2 ErrorMessage => Str

The error message containing the reason why the prepared statement
could not be returned. The following error messages are possible:

=over

=item *

C<INVALID_INPUT> - The name of the prepared statement that was provided
is not valid (for example, the name is too long).

=item *

C<STATEMENT_NOT_FOUND> - A prepared statement with the name provided
could not be found.

=item *

C<UNAUTHORIZED> - The requester does not have permission to access the
workgroup that contains the prepared statement.

=back



=head2 StatementName => Str

The name of a prepared statement that could not be returned due to an
error.



